var taxiData = Data[0][1];
var heatmapData, heatmap;
function initialize() {
        var styles =  [
                        {
                          featureType: "all",
                          elementType: "all",
                          stylers: [
                            { saturation: -100 } // <-- THIS
                          ]
                        }
                    ];
        var mapOptions = {
          center: new google.maps.LatLng(39.085937, -94.546724),
          zoom: 11,
          styles:styles,
        };

  map = new google.maps.Map(document.getElementById('map'),
      mapOptions);


  var heatmapData = [];
  for (var i = 0; i < taxiData.length; i++) {
    var latLng = new google.maps.LatLng(taxiData[i][0], taxiData[i][1]);
    var magnitude = taxiData[i][2];
    var weightedLoc = {
      location: latLng,
      weight: magnitude
    };
    heatmapData.push(weightedLoc);
  }


  heatmap = new google.maps.visualization.HeatmapLayer({
    data: heatmapData,
    radius: .009,
    dissipating:false,
    //opacity:1,
    maxIntensity:.1,

  });



  heatmap.setMap(map);

}

// Start of code for updating map
//google.maps.event.addListener(heatmapData);

function updateData(m) {  
	var newmapData = []
	var taxi = Data[m][1];
	for (var i = 0; i < taxi.length; i++) {
    var latLng = new google.maps.LatLng(taxi[i][0], taxi[i][1]);
    var magnitude = taxi[i][2];
    var weightedLoc = {
      location: latLng,
      weight: magnitude
    };

    newmapData.push(weightedLoc);
  };

  heatmap.set('data',heatmap.get('data')? newmapData:newmapData);
  document.getElementById('yrmth').innerHTML = 'Data for'+' '+Data[m][0];

}

for (i=1;i<Data.length;i++){setTimeout(updateData,2000*(i+1),i)};

// End of code for updating map


google.maps.event.addDomListener(window, 'load', initialize);
